settings.markdownTextFunction:
let buttonsHtml = "" 
ctx.actionsApi.getActionDescriptors('elementClick').forEach((btn, index)=>{
    let disabled =false;
    if (index == 2) {
        disabled = data[0] && data[0].RemoteLoggingLevel ? data[0].RemoteLoggingLevel == "NONE" : true;
    } else if (index == 4) {
        const conf = data[0].general_configuration? JSON.parse(data[0].general_configuration): {};
        disabled = !conf.remoteShell;
    }
    buttonsHtml += `<button mat-raised-button disabled=${disabled} color="primary"(click)="ctx.actionsApi.handleWidgetAction($event, ctx.actionsApi.getActionDescriptors('elementClick')[${index}], ctx.datasources[0].entity.id)" fxFlex fxflex.md="50">${btn.displayName}</button>`
});

return `<div class="action-buttons-container" fxLayout="columnd" fxLayout.md="row wrap" fxLayoutGap="5px" >${buttonsHtml}</div>`;

