let $injector = widgetContext.$scope.$injector;
let customDialog = $injector.get(widgetContext.servicesMap.get('customDialog'));

openCommands();

function openCommands() {
    customDialog.customDialog(htmlTemplate, CommandsDialogController, {panelClass: "test"}).subscribe();
}

function CommandsDialogController(instance) {
    let vm = instance;

    vm.entityId = entityId.id;

    vm.cancel = function() {
        vm.dialogRef.close(null);
    };
}
